import axios from 'axios'
import * as dotenv from 'dotenv'
dotenv.config({ path: '../../.env' })

axios.create({
    baseURL: process.env.REACT_APP_BASE_URL,
    headers: {
        "Content-type": "application/json"
    }
})

export default class Api {

    index = async () => {
        const data = await axios.get('/index')
        console.log(data)
    }
}
